package main

import (
	"fmt"
	"strings"
)

func firstOccurence(input string) string {
	var result string

	// take out the first character from the input.
	first_char := input[:1]

	// keep the remaining characters as separate slice of string
	remaining_chars := input[1:]

	// capturing first occurence characters
	result += first_char

	for {
		// remove duplicate characters of "first_char" from "remaining_chars".
		// we don't need them anymore.
		remaining_chars = strings.ReplaceAll(remaining_chars, first_char, "")

		if len(remaining_chars) <= 0 {
			break
		}

		first_char = remaining_chars[:1]
		remaining_chars = remaining_chars[1:]
		result += first_char
	}

	return result
}

func main() {
	// input := "sebaerb"
	input := ""

	result := firstOccurence(input)

	fmt.Printf("result : %s\n", result)

}
